INSERT INTO "public"."movies" ("id","actors","description","director","duration","genre","release_date","status","title","image") VALUES (1, 'Dong-won Gang, Jung-hyun Lee, John D. Michaels', '<p>Vì số tiền công hậu hĩnh lên đến 2,5 triệu USD, tay cựu quân nhân Jung Seok quyết định trở lại “Bán Đảo” nhằm thu hồi một kiện hàng nọ. Tuy nhiên, đón đợi Jung Seok và đồng đội trở về là cuộc phục kích của những chiến hữu cũ và sự tấn công của lũ zombie khát máu. Được gia đình Min Jung giải cứu, Jung Seok phải tìm cách đào thoát khỏi nơi đây trước khi mặt trời ló dạng.</p>', 'Sang-ho Yeon', 115, 'Hành Động, Kinh Dị, Phiêu Lưu', '2020-12-11', 1, 'BÁN ĐẢO PENINSULA', NULL),(2, 'Federico Ielapi, Roberto Benigni, Marine Vacth, Gigi Proietti, Massimo Ceccherini', '<p>Chuyển thể từ cuốn sách Những cuộc phiêu lưu của Pinocchio của nhà văn người Ý Carlo Collodi từng làm say mê bao thế hệ độc giả khắp thế giới, bộ phim kể về Pinocchio - chú bé người gỗ do bác thợ mộc Gepetto tạo nên, khao khát trở thành một câu bé đích thực bằng xương bằng thịt. Với chất liệu văn học tuyệt vời, cùng diễn xuất ấn tượng của chủ nhân tượng vàng Oscar - Roberto Benigni, phim đã nhận về 15 đề cử David di Donatello 2020 – giải thưởng điện ảnh cao quý, được xem như Oscars của Ý, bao gồm đề cử cho Đạo diễn xuất sắc nhất và Phim xuất sắc nhất. </p>', 'Matteo Garrone', 125, 'Gia đình, Phiêu Lưu, Tâm Lý, Thần thoại', '2020-12-12', 1, 'CẬU BÉ NGƯỜI GỖ PINOCCHIO', NULL),(5, 'Brenton Thwaites, Theo Rossi, Kyle Gallner', '<p>Năm người lính Mỹ được giao nhiệm vụ canh giữ một dinh thự tại Pháp trong những năm cuối Thế chiến II. Họ rơi vào tình trạng hoảng loạn khi gặp phải một kẻ thù còn đáng sợ hơn rất nhiều những gì họ từng trải qua trên chiến trường.</p>', 'Eric Bress', 95, 'Hồi hộp, Kinh Dị', '2020-12-15', 1, 'DINH THỰ OAN KHUẤT', NULL),(6, 'Albert Adion', '<p>Sau tai nạn thảm khốc, Riley may mắn sống sót nhưng Chris đã mãi mãi ra đi. Bằng một phép màu, cả hai đã tìm cách kết nối với nhau giữa hai thế giới. Nhưng liệu tình yêu có giúp họ vượt qua khoảng cách và bên cạnh nhau mãi mãi?</p>', 'Nel Valchino', 122, '2D | Normal | Normal sound | Phụ đề', '2020-12-16', 1, 'MÃI BÊN EM', NULL),(7, 'Ryan Potter; Scott Adsit; Jamie Chung', '<p>Lấy bối cảnh tại thành phố giả tưởng San Fransokyo, thiên tài chế tạo robot Hiro Hamada, nhờ sự định hướng và cổ vũ của người anh trai Tadashi, quyết tâm sử dụng tài năng thiên bẩm của mình một cách nghiêm túc và giúp ích cho cộng đồng. Nhưng bỗng một biến cố bất ngờ ập đến đe dọa San Fransokyo, Hiro cùng với chú robot Baymax tự chế tạo ra, đã hợp lực với những người bạn cùng chí hướng như Go Go Tamago, Wasabi, Honey Lemon và Fred để cùng nhau lên đường chiến đấu bảo vệ thành phố.</p>', 'Don Hall; Chris Williams', 107, 'Hoạt Hình', '2020-12-17', 1, 'BIỆT ĐỘI BIG HERO 6', NULL),(8, NULL, '<p>Trong suốt 200 năm, tộc người tí hon Elfkins đã sống sâu dưới lòng đất và hạn chế tiếp xúc với con người vì nghĩ rằng họ rất xấu xa. Một ngày nọ, cô bé Helvi tí hon không chịu nổi sự tù túng và chật chội của lòng đất, cô quyết định “phá luật’’ và trèo lên mặt đất. Đồng hành với cô là hai anh bạn Buck và Kipp. Ở đó, bộ ba đã gặp gỡ và kết bạn với Theo – một thợ làm bánh tài năng. Sau nhiều chuyện dở khóc dở cười, Helvi đã xây dựng được một tình bạn đáng yêu giữa tí hon và con người. Cuối cùng, chính tình bạn này đã giúp tất cả nhận ra giá trị tốt đẹp trong cuộc sống đó chính là giúp đỡ lẫn nhau.</p>', 'Ute von Münchow-Pohl', 78, 'Hoạt Hình', '2020-12-18', 1, 'TÍ HON HẬU ĐẬU', NULL),(9, 'Jessica McNamee, Luke Mitchell, Amali Golden', '<p>Bỏ qua dự báo về cơ bão sắp đến, một nhóm bạn cùng nhau khám phá một hang động mới. Tưởng chừng sẽ an toàn dưới lòng đất, một cơn lũ ập đến khiến họ mất phương hướng. Sự hoảng loạn càng tăng khi mực nước đang không ngừng dâng cao. Tuy nhiên đó chưa phải là tất cả, cơn bão còn mang đến những kẻ săn mồi đói khát đang chực chờ họ dưới dòng nước tối.</p>', 'Andrew Traucki', 106, 'Hành động, Phiêu lưu', '2020-12-12', 1, 'CÁ SẤU TỬ THẦN', NULL),(10, NULL, '<p>Simon là cậu bé mồ côi sở hữu một năng lực vô cùng đặc biệt, đó là khả năng biến đổi ngoại hình thành bất cứ người nào cậu bé từng chạm vào. Trong một lần cùng nhau vào rừng chơi, bạn thân nhất của Simon không may trượt chân rơi xuống vực và Simon trở thành nhân chứng duy nhất. Vừa sợ hãi bị kết tội, vừa khao khát có một gia đình hạnh phúc, Simon đã biến thành người bạn của mình và sống với danh tính của cậu ấy. 10 năm trôi qua, bí mật của Simon dường như đã bị chôn vùi, cho đến một ngày...</p>', 'Leo Karmann', 103, 'Gia đình, Tình cảm', '2020-12-13', 1, 'KẺ CẮP NHÂN DẠNG ', NULL),(11, 'Addy Miller, Elizabeth Birkner, Jan Broberg', '<p>Câu chuyện của Behind You xoay quanh hai đứa trẻ là Olivia (Addy Miller) và em gái Claire (Elizabeth Birkner). Sau cái chết đột ngột của người mẹ còn cha ở nước ngoài, cả hai buộc phải đến sống cùng dì Beth (Jan Bronberg). Tuy nhiên, Olivia dần nhận ra những biểu hiện và hành động kỳ quái của người dì. Từ đây, hàng loạt sự kiện kinh hoàng bắt đầu diễn ra khiến tính mạng của hai chị em đều gặp nguy hiểm.</p>', 'Andrew Mecham, Matthew Whedon', 86, 'Kinh Dị', '2020-12-14', 1, 'HẦM QUỶ', NULL),(3, 'Kym Cramp, Brendan Donoghue, Lauren Lofberg,…', '<p>Outback xoay quanh trải nghiệm du lịch đầy kinh hoàng của cặp vợ chồng trẻ Wade và Lisa khi họ quyết định đi đến Úc nhằm tìm kiếm những phút giây riêng tư cùng nhau giữa thiên nhiên hoang dã. Tuy nhiên, bộ đôi đã bị lạc giữa một vùng thảo nguyên hoang vắng, họ buộc phải rời khỏi xe và đi bộ để tìm một tuyến đường mới. Khi màn đêm buông xuống, cặp đôi phải ngủ qua đêm giữa những bụi rậm chứa đầy rắn, bò cạp và chó hoang rình rập. Liệu Wade và Lisa sẽ sống sót qua chuyến du lịch chết chóc này như thế nào?</p>', 'Mike Green', 86, 'Hồi hộp', '2020-12-10', 1, 'CHUYẾN DU LỊCH CHẾT CHÓC', NULL),(12, 'Byeong-man Jo, Gye-yeol Kang', '<p>Ông Bà Jo Byong-man và Kang Gye-yeul tuổi cao sức yếu nhưng ở họ là hình ảnh của những đôi lứa mới vừa chớm nở yêu thương. Khi họ ở cạnh nhau, ông vẫn thường trao cho bà những ân cần nhỏ nhặt nhất mà đôi khi những đôi trẻ còn chưa thể nào sánh bằng.</p>', 'Mo-young Jin', 86, 'Phim tài liệu', '2021-01-15', 1, 'MÌNH ƠI, XIN ĐỪNG QUA SÔNG', NULL),(13, 'Dave Bautista, Chloe Coleman, Kristen Schaal, Ken Jeongs', '<p>Jason Jones, hay còn gọi là JJ (Dave Bautista) – một điệp viên CIA dày dạn kinh nghiệm. Trong một lần thực địa, JJ bị cô bé 9 tuổi Sophie (Chloe Coleman) phát hiện và uy hiếp anh phải “gia sư” môn điệp viên cho mình nếu không muốn cả thế giới biết thân phận thực sự của anh. Mắc kẹt bên cô học trò lắm mưu nhiều mẹo, JJ dần phát hiện ra Sophie thực sự có tố chất và năng khiếu bẩm sinh cho việc trở thành điệp viên.</p>', 'Peter Segal', 101, 'Hài, Hành Động', '2021-01-16', 1, 'ĐIỆP VIÊN SIÊU LẦY', NULL),(14, 'Milos Bikovic, Aleksey Serebryakov, Lyubov Aksyonova', '<p>Một kiến trúc sư trẻ tài năng tỉnh dậy sau một tai nạn kinh hoàng và phát hiện rằng anh ta đang lạc trong một thế giới khác kỳ lạ và hỗn loạn. Thế giới đó được gọi là COMA và ở đó những toà nhà, những dòng sông và thành phố đều có thể tồn tại trong cùng một không gian của một căn phòng. Những định luật vật lý anh được học không còn đúng ở thế giới này và bên cạnh việc thích nghi, anh ta còn phải chiến đấu để bảo vệ mạng sống của mình cũng như tìm cách để thoát ra, trở về với thế giới thực...</p>', 'Nikita Argunov', 111, 'Khoa Học Viễn Tưởng', '2021-01-17', 0, 'KẺ ĐÀO TẨU GIẤC MƠ', NULL),(15, 'Hwang Jung Min, Lee Jung Jae, Park Jeong Min', '<p>In-nam (Hwang Jung Min) – một tay sát thủ đã giải nghệ và Yui (Park Jeong Min) gặp nhau tại Thái Lan để tìm kiếm đứa con gái bị bắt cóc mà In-nam chưa một lần gặp mặt. Cuộc chạy đua với thời gian này trở nên khó khăn hơn bao giờ hết khi cả hai phải đương đầu với sự bám đuổi gắt gao từ Ray (Lee Jung Jae). Tên “đồ tể” máu lạnh truy sát In-nam sau khi biết rằng anh trai mình đã bị giết hại, Ray quyết tâm đòi lại món nợ máu này bằng mọi giá. </p>', 'Hong Won Chan', 104, 'Hành Động, Tội phạm', '2021-01-18', 1, 'ÁC QUỶ ĐỐI ĐẦU', NULL),(16, 'Jesse Metcalfe, Bruce Willis, Lala Kent', '<p>ĐỐI ĐẦU xoay quanh đội lính đánh thuê của Derek Miller (Jesse Metcalfe) đảm nhận nhiệm vụ giải cứu con gái của ông trùm tập đoàn công nghệ (Bruce Willis) thoát khỏi âm mưu độc đoán của Kẻ rửa tội (Sergio Rizzuto)</p>', 'Matt Eskandari', 94, 'Hành Động, Hồi hộp', '2021-01-19', 1, 'ĐỐI ĐẦU', NULL),(17, 'Janelle Monáe, Eric Lange, Jena Malone', '<p>TỪ NHÀ SẢN XUẤT CỦA GET OUT VÀ US Nữ nhà văn, diễn giả nổi tiếng và vô cùng thành công Veronica (Janelle Monáe) bị một thế lực bí ẩn kéo về kỷ nguyên Antebellum, thời kỳ tiền nội chiến kinh hoàng của quá khứ, khi những người Mỹ gốc Phi giống cô bị bắt làm nô lệ. Veronica buộc phải tìm mọi cách để sống sót, chiến đấu và giành lại cuộc sống vốn có của mình...</p>', 'Gerard Bush, Christopher Renz', 106, 'Hồi hộp, Kinh Dị', '2021-01-20', 1, 'ANTEBELLUM', NULL),(18, 'BTS', '<p>Break The Silence: The Movie hứa hẹn sẽ là “cuốn nhật ký” bằng hình ảnh đầy chân thực, sống động và ngập tràn cảm xúc của nhóm nhạc hàng đầu thế giới, được ghi lại từ chuỗi concert cháy vé “Love Yourself: Speak Yourself” của BTS trong năm 2019.</p>', 'Park Jun-Soo', 91, 'Hòa nhạc, Nhạc kịch', '2021-01-21', 1, 'BTS: BREAK THE SILENCE THE MOVIE', NULL),(19, 'Gerard Butler, Morena Baccarin, Scott Glenn', '<p>Gia đình John Garrity và Allison, cùng con trai Nathan, tìm đường trốn chạy khỏi thảm họa thiên thạch trong vòng 48h.</p>', 'Ric Roman Waugh', 90, 'Hành Động, Hồi hộp', '2021-01-22', 1, 'GREENLAND: THẢM HỌA THIÊN THẠCH', NULL),(20, 'Eva Hache, José Mota, Ana Ángeles García', '<p>Sinh ra với sự khác biệt, cô gà mái Turu không thể đẻ trứng như các bạn gà mái khác và luôn mang trong lòng sự tự tin về bản thân. Cuộc đời của Turu bước sang một trang mới khi cô gà bé nhỏ được nhận nuôi bởi Isabel, một giáo viên âm nhạc đã nghỉ hưu. Quyết định chơi các bài hát với hy vọng rằng âm nhạc sẽ giúp Turu đẻ trứng, Isabel khám phá ra rằng cô gà của mình có thể hiểu được tiếng người và còn có một giọng hát vô cùng truyền cảm. Tai nạn không may khiến Isablel phải rời xa nông trang. Để gặp lại được Isabel, Turu sẽ trải qua một hành trình đặc biệt mà cô không hề ngờ tới.</p>', 'Eduardo Gondell, Víctor Monigote', 100, 'Hoạt Hình', '2021-01-19', 1, 'TURU: GÀ TÂY MÊ QUẨY', NULL),(21, 'Tcheky Karyo, Rossy de Palma, Marilyn Lima, Romane Bohringer, Alexis Michalik', '<p>Sau những đổ vỡ trong tình yêu, chàng ca sĩ nghiệp dư Gaspard đã nguyện chẳng yêu ai nữa. Còn với nàng tiên cá Lula, nàng luôn bảo vệ chính mình khỏi tình yêu bằng giọng hát ma mị, khiến cho bất cứ người đàn ông nào nghe thấy đều phải chết. Thế nhưng, dòng sông Seine đã thay đổi tất cả khi cuốn nàng Lula đến với cuộc đời Gaspard trong một cơn thuỷ triều. Và rồi người đàn ông vốn đau khổ vì tình và nàng tiên cá chưa hề biết tới mùi vị tình yêu đã tìm được cách bước vào trái tim nhau. Hai thế giới trở nên đồng điệu trong khúc ca tình yêu của họ.</p>', 'Mathias Malzieu', 101, 'Tâm Lý, Thần thoại, Tình cảm', '2021-01-20', 1, 'NÀNG TIÊN CÁ Ở PARIS', NULL),(22, 'David Menkin, David Rintoul, Gavin Peter', '<p>Một buổi sáng, những con vật trong rừng thức dậy và phát hiện ra một sự thật động trời rằng chúng có thể nói được! Khủng khiếp hơn nữa, bỗng một người ngoài hành tinh xuất hiện! Fneep – một Scaldronian màu tím bé nhỏ trên con đường chinh phục hành tinh đầu tiên của đời mình đang bị mắc kẹt ở Trái Đất với chiếc phi thuyền bị hỏng. Biệt đội rừng xanh bao gồm khỉ Munki tinh nghịch, voi Trunk hiền lành, nhím Humph cáu kỉnh và những người bạn đáng yêu khác cùng bắt tay nhau giúp Fneep trở về hành tinh của mình. Fneep dần nhận ra rằng, tình bạn là sức mạnh lớn lao và ý nghĩa hơn cả những cuộc chinh phục không gian. Không ai ngờ tới, một tàu vũ trụ khổng lồ mang theo binh đoàn Scaldronian ập tới Trái Đất. Fneep sẽ bảo vệ những người bạn mới của mình hay tuân lệnh của Ngài Chỉ huy lạnh lùng đàn áp hành tinh xanh và biến tất cả động vật thành tù binh?</p>', 'Brent Dawer', 98, 'Gia đình, Phiêu Lưu, Tâm Lý', '2020-12-21', 1, 'VÌ SAO ĐƯA BẠN TỚI', NULL),(23, 'Nhã Phương, Trương Thế Vinh, Tiến Luật, Thuận Phát, Khương Ngọc, Hoàng Phi...', '<p>Lấy cảm hứng từ khái niệm “hiệu ứng cánh bướm”, bộ phim là câu chuyện về một người phụ nữ phải tìm cách sửa chữa sai lầm của mình khi vô tình thay đổi quá khứ, khiến cuộc sống hiện tại bị đảo lộn.</p>', 'Nguyễn Hữu Hoàng', 116, 'Bí ẩn, Hồi hộp, Tâm Lý', '2021-01-22', 1, 'SONG SONG', NULL),(24, 'Gal Gadot, Chris Pine, Kristen Wiig, Pedro Pascal, Connie Nielsen', '<p>Lấy bối cảnh năm 1984, 66 năm sau sự kiện diễn ra Thế Chiến thứ I (1918) ở phần phim đầu tiên, Wonder Woman tái hợp với người yêu tưởng chừng đã qua đời Steve Trevor, đồng thời đương đầu với hai kẻ thù mới là Max Lord và The Cheetah.</p>', 'Patty Jenkins', 132, 'Hành Động, Thần thoại', '2021-01-19', 1, 'WONDER WOMAN 1984', NULL),(25, 'Lương Anh Vũ, Hồ Thu Anh', '<p>''Sài Gòn Trong Cơn Mưa'' là câu chuyện về tình yêu & ước mơ của những người trẻ tứ xứ tìm thấy nhau giữa Sài Gòn và rồi lạc mất nhau cũng ở giữa Sài Gòn. Còn bạn? Liệu đã gặp được ‘thanh xuân’ của mình dưới cơn mưa đầu mùa nào hay chưa?</p>', 'Lê Minh Hoàng', 101, 'Tình cảm', '2021-01-20', 1, 'SÀI GÒN TRONG CƠN MƯA', NULL),(26, 'Thái Hoà, Đức Thịnh, Hồng Ánh, Hứa Vỹ Văn , Thu Trang, Kiều Minh Tuấn, Kaity Nguyễn', '<p>Trong buổi họp mặt của nhóm bạn thân, một thành viên bất ngờ đề xuất trò chơi chia sẻ điện thoại nhằm tăng tinh thần “đoàn kết”. Từ đó, những góc khuất của từng người dần hé lộ và khiến cho mối quan hệ vốn khắng khít của họ bắt đầu lay chuyển.</p>', 'Nguyễn Quang Dũng', 101, 'Hài, Tâm Lý', '2021-01-21', 1, 'TIỆC TRĂNG MÁU', NULL),(27, 'Hoàng Thùy Linh, B Trần, Hứa Vĩ Văn, Trịnh Thăng Bình, Hạnh Thúy, Kay Trần…', '<p>‘Trái Tim Quái Vật’ là một câu chuyện đậm chất thriller kể về Khánh (Hoàng Thùy Linh) – một người mẹ đơn thân với khao khát được sống và làm ăn lương thiện nhưng không may vướng vào vòng xoáy tội ác. Bị tình nghi là kẻ giết người tại khu chung cư của mình, Khánh bị dồn đến bước đường cùng và phải ôm con trai bỏ trốn. Câu chuyện càng trở nên phức tạp hơn khi phát hiện hàng loạt vụ án mạng khác cùng sự xuất hiện của Lâm (B Trần), ông Bé (Hứa Vĩ Văn) và Dustin (Trịnh Thăng Bình). Đến tận cùng tội ác, liệu điều gì đang ẩn giấu đằng sau và ai mới là người mang “Trái Tim Quái Vật”? Bộ phim dự kiến khởi chiếu từ ngày 16.10.2020.</p>', 'Tạ Nguyên Hiệp', 115, 'Hồi hộp, Tâm Lý', '2021-01-22', 1, 'TRÁI TIM QUÁI VẬT', NULL),(28, 'Yahya Abdul-Mateen II, Teyonah Parris, Nathan Stewart-Jarrett, Colman Domingo', '<p>Từ lúc nào không ai hay biết, các dự án nhà ở tại khu Cabrini-Green ở Chicago đã bị khủng bố bởi câu chuyện truyền miệng về một kẻ giết người siêu nhiên với chiếc tay móc câu. Hắn có thể dễ dàng được triệu tập nếu bạn dám nhắc lại tên hắn năm lần trước gương. Ngày nay, một thập kỷ sau khi tòa tháp Cabrini cuối cùng bị phá hủy, nghệ sĩ thị giác Anthony McCoy và người yêu của anh, giám đốc phòng trưng bày Brianna Cartwright di chuyển vào một căn hộ gác xép sang trọng ở Cabrini, giờ đây được cải tạo lại và định cư bởi thế hệ người trẻ năng động. Khi sự nghiệp vẽ tranh của Anthony đang trên bờ vực đình trệ, cuộc gặp gỡ tình cờ với một cư dân cũ của khu Cabrini-Green phơi bày cho Anthony sự thật kinh hoàng về câu chuyện Candyman. Lo lắng để duy trì vị thế của mình trong giới nghệ thuật Chicago, Anthony bắt đầu phát hiện những chi tiết rùng rợn trong xưởng vẽ của mình và anh cũng lấy chúng làm cảm hứng cho các tác phẩm mới. Anh không hề hay biết những điều này đang vô tình mở ra một cánh cửa dẫn tới quá khứ phức tạp, đưa anh tới định mệnh của chính mình. Từ đó anh dần trở nên mất tỉnh táo và rơi sâu hơn vào vòng xoáy bạo lực đáng sợ.</p>', 'Nia DaCosta', 110, 'Kinh Dị', '2021-01-19', 1, 'SÁT NHÂN TRONG GƯƠNG', NULL),(29, 'Gal Gadot, Armie Hammer, Rose Leslie', '<p>Án Mạng Trên Sông Nile xoay quanh chuyến đi tham quan Ai Cập của thám tử Poirot. Trên chiếc du thuyền nhỏ, ông bắt gặp một cặp nam thanh nữ tú: nàng triệu phú trẻ Linnet Doyle và người chồng mới cưới Simon Doyle đang hưởng tuần trăng mật. Chuyến đi hạnh phúc của hai người bị phá hỏng bởi người tình cũ của Simon - Jacqueline de Bellefort không ngừng bám theo phá đám.</p>', 'Kenneth Branagh', 119, 'Tâm Lý, Tội phạm', '2021-01-20', 1, 'ÁN MẠNG TRÊN SÔNG NILE', NULL),(30, 'Scarlett Johansson, Florence Pugh, Robert Downey Jr...', '<p>Phần phim riêng của Natasha Romanoff bất ngờ tung teaser chính thức với những cảnh hành động mãn nhãn, mang đậm chất điệp viên. Bên cạnh đó, phần phim này cũng sẽ hé lộ quá khứ đen tối và quá trình biến cô trở thành một Black Widow.</p>', 'Cate Shortland', 123, 'Hành Động, Phiêu Lưu', '2021-01-21', 1, 'GÓA PHỤ ĐEN', NULL),(118, 'Test luôn nha', 'Test luôn nha', 'Test luôn nha', 0, 'Test luôn nha', '2021-01-15', 0, 'Test tao phim so 3 cap nhat so 4', NULL),(116, 'Test luôn nha', 'Test luôn nha', 'Test luôn nha', 0, 'Test luôn nha', '2021-01-15', 0, 'Test tao phim so 2', NULL),(114, 'Test luôn nha', 'Test luôn nha', 'Test luôn nha', 110, 'Test luôn nha', '2020-02-12', 0, 'Test không phim nha', NULL),(113, 'Test luôn nha', 'Test luôn nha', 'Test luôn nha', 110, 'Test luôn nha', '2020-02-12', 0, 'Test phim', NULL),(115, 'Test luôn nha', 'Test luôn nha', 'Test luôn nha', 0, 'Test luôn nha', '2021-01-15', 0, 'Test tao phim', NULL),(121, 'Thái Hoà, Đức Thịnh, Hồng Ánh, Hứa Vỹ Văn , Thu Trang, Kiều Minh Tuấn, Kaity Nguyễn', '<p>Trong buổi họp mặt của nhóm bạn thân, một thành viên bất ngờ đề xuất trò chơi chia sẻ điện thoại nhằm tăng tinh thần “đoàn kết”. Từ đó, những góc khuất của từng người dần hé lộ và khiến cho mối quan hệ vốn khắng khít của họ bắt đầu lay chuyển.</p>', 'Nguyễn Quang Dũng', 101, 'Hài, Tâm Lý', '2021-01-21', 1, 'TIỆC TRĂNG MÁU 2', NULL),(151, 'Minus accusantium ve', '<p>Sint, distinctio. Vo.</p>', 'Et ullam esse invent', 82, 'Omnis enim culpa ut ', '2021-01-17', 0, 'Doloremque voluptate', NULL),(120, 'Test luôn nha', '<p>Test luôn nha Test luôn nhaTest luôn nhaTest luôn nhaTest luôn nhaTest luôn 